import * as React from 'react';
import CustomHeader from '../components/CHeader'
import { Text, View, SafeAreaView } from 'react-native'
import { StackActions } from '@react-navigation/native';
import Clrs from "../constants/Colors";
import Svg, { Defs, Path, ClipPath, Use } from "react-native-svg"

export default function HomeScreen({ navigation }) {
  return (
    <View style={{ flex: 1 }}>
      <CustomHeader title="TEST MAIN" isHome={true} navigation={navigation} />
      <View style={{ flex: 1, alignItems: 'center', justifyContent: 'center', backgroundColor: Clrs.BGreen }}>
        <Svg
          width={48}
          height={1}
          viewBox="0 0 48 1"
          xmlns="http://www.w3.org/2000/svg"
          {...props}
        >
          <Path d="M0 0h48v1H0z" fill="#063855" fillRule="evenodd" />
        </Svg>
        <Text style={{ fontSize: 24, marginBottom: 10, marginTop: 20, color: Clrs.BYellow }} onPress={() => navigation.toggleDrawer()} >Welcome To Home Screen</Text>
        <Text style={{ fontSize: 14, marginBottom: 10, marginTop: 60, color: Clrs.BYellow }} onPress={() => navigation.dispatch(StackActions.replace('Root'))} >Logout</Text>
      </View>
    </View>
  );
}

HomeScreen.navigationOptions = {
  header: null,
};
